import React from 'react';
import { Route, Routes, useNavigate } from "react-router-dom";
import Header from '../Header/Header';
import Main from '../Main/Main';
import Footer from '../Footer/Footer';
import './App.css';


function App() {
  const navigate = useNavigate();


  return (
    <div className='page'>
      <Header></Header>
      <Main></Main>
      <Footer></Footer>
    </div>
  )
}
export default App;
